import React from 'react'
import { Box, Tooltip, IconButton, Fab } from '@mui/material'
import {Add} from '@mui/icons-material'

const AddPost = () => {
  return (
    <Box >
        <Tooltip title="Delete" sx={{
          position:"fixed",
          bottom:"20px",
          left:{
            xs:"calc(50% -25px)",
            md:30,
          }
        }}>
        <Fab color="primary" aria-label="add">
          <Add />
        </Fab>
        </Tooltip>
    </Box>
  )
}

export default AddPost
